pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "./Process.sol";

contract CooperativeSignaling {

    Process[] public CurrentProcesses;

    function init(address M) 
    public 
    returns (address){

        Process newProcess = new Process().withTarget(msg.sender).withMitigator(M);
        CurrentProcesses.push(newProcess);

        return newProcess.getAddress();
    }

    function approve(address process,bool descision) 
    public
    returns (address){
        ProcessSearchResult memory ProcessToUse = findProcess(process);
        
        require(ProcessToUse.existing,"Process not existing");
        
        ProcessToUse.FoundProcess.setState(Process.State.ABORT);

        return ProcessToUse.FoundProcess.getAddress();
    }

    function findProcess(address process) 
    public view 
    returns(ProcessSearchResult memory){
        Process FoundProcess;
        ProcessSearchResult memory result = ProcessSearchResult({FoundProcess:FoundProcess,existing:false});
        for (uint i = 0 ; i < CurrentProcesses.length; i++) {
            if(CurrentProcesses[i].getAddress()==process){
                result.FoundProcess = CurrentProcesses[i];
                result.existing = true;
            }
        }
        return result;
    }

    struct ProcessSearchResult{
        Process FoundProcess;
        bool existing;
    }
}
